"use strict";

function cache(f) { return f; }
const { accumulate } = require('itertools');
const math = require('mathjs');
const { inf } = require('mathjs');
function f_gold(sentence, k) {
    function dfs(i) {
        if (s[s.length - 1] - s[i] + n - i - 1 <= k) {
            return 0;
        }
        let ans = inf, j = i + 1;
        while (j < n && (t := s[j] - s[i] + j - i - 1) <= k) {
            ans = math.min(ans, math.pow(k - t, 2) + dfs(j));
            j += 1;
        }
        return ans;
    }
    const t = sentence.split(' ').map(w => w.length);
    const n = t.length;
    const s = [...accumulate(t, (a, b) => a + b, 0)];
    return dfs(0);
}
